  quote?: (Partial<string> & Partial<Quote>) | null;
  receipt_number?: string | null;
  starting_balance: number;
  statement_descriptor?: string | null;
  status?: 'deleted' | 'draft' | 'open' | 'paid' | 'uncollectible' | 'void' | null;
  status_transitions: InvoicesStatusTransitions;
  subscription?: (Partial<string> & Partial<Subscription>) | null;
  subscription_proration_date?: number;
  subtotal: number;
  tax?: number | null;
  threshold_reason?: InvoiceThresholdReason;
  total: number;
  total_discount_amounts?: Array<DiscountsResourceDiscountAmount> | null;
  total_tax_amounts: Array<InvoiceTaxAmount>;
  transfer_data?: Partial<InvoiceTransferData> | null;
